INSERT INTO `sp_blog` VALUES (1, '212a2ace2dc03509e65b53f449001c60', 'Logical Elements Rule Method', 'logical-elements-rule-method', 'The aim of this study was to create a step-by-step method for transforming clinical rules for use in decision support, and to validate this method for usability and reliability.', 'https://images.pexels.com/photos/12210049/pexels-photo-12210049.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1', '&lt;p&gt;The resulting method, called the Logical Elements Rule Method, consists of 7 steps: (1) restate the rule proactively; (2) restate the rule as a logical statement (preserving key phrases); (3) assess for conflict between rules; (4) identify concepts which are not needed; (5) classify concepts as crisp or fuzzy, find crisp definitions corresponding to fuzzy concepts, and extract data elements from crisp concepts; (6) identify rules which are related by sharing patients, actions, etc.; (7) determine availability of data in local systems. Validation showed that the method was usable with rules from various sources and clinical conditions, and reliable between users provided that the users agree on a terminology and agree on when the rule will be evaluated.&lt;/p&gt;\r\n\r\n&lt;p&gt;A sample set of clinical rules was identified from the relevant literature. Using an iterative approach with a focus group of mixed clinical and informatics experts, a method was developed for assessing and formalizing clinical rules. &lt;strong&gt;Two assessors then independently applied the method to a separate validation set of rules.&lt;/strong&gt; Usability was assessed in terms of the time required and the error rate, and reliability was assessed by comparing the results of the two assessors.&lt;/p&gt;', 1, 1, '2022-06-30 15:30:40', '2022-06-30 15:29:56');
INSERT INTO `sp_blog` VALUES (2, '55b8ab96d0ae97002163f75f07957390', 'What is Lorem Ipsum', 'what-is-lorem-ipsum', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled', 'https://support.yourpayroll.com.au/hc/article_attachments/360002395915/mceclip0.png', '&lt;p&gt;&lt;strong&gt;Lorem Ipsum&lt;/strong&gt;&amp;nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&amp;#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.&lt;/p&gt;', 2, 1, '2022-06-30 15:33:43', '2022-06-30 15:33:43');
INSERT INTO `sp_blog` VALUES (3, '0e1e19fcdfcf5464c84ee5f96044dded', 'Why do we use it?', 'why-do-we-use-it', 'It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.', 'https://s2628.hemsida.eu/laravel/public/themes/backend/default/assets/img/logo12.png', '&lt;p&gt;It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &amp;#39;Content here, content here&amp;#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &amp;#39;lorem ipsum&amp;#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).&lt;/p&gt;', 3, 1, '2022-06-30 15:34:49', '2022-06-30 15:34:49');
