INSERT INTO `sp_options` VALUES (58, 'privacy_policy', '&lt;p&gt;&lt;strong&gt;Privacy policy&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nYou are welcome to use the Laterly Community Management Service Platform (hereinafter referred to as Party A) and you who use our platform. (hereinafter referred to as Party B).&lt;br /&gt;\r\nThe following instructions are how we collect, use, disclose, transfer and store your information when you use our platform. Any questions or comments are welcome to provide us with reference, which will help us to make products, services, content, and advertising better.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;User privacy protection instructions&lt;/strong&gt;&lt;br /&gt;\r\nParty A will protect Party B&amp;#39;s privacy rights in accordance with the law. Party A&amp;#39;s personal data registered or retained by Party B will only be used for internal filing and within the scope of services provided by Party A for publicity marketing and notification. Party A has strengthened relevant protection measures, but also solemnly reminds Party B: Do not publicly disclose Party B&amp;#39;s personal information on the Internet, as it may be collected and used by others, especially in public speaking on the Internet, such as chatting. Room, message board, should also avoid publishing personal information such as personal identity, password or email.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Personal data collection and use&lt;/strong&gt;&lt;br /&gt;\r\nWhen Party B joins a member, subscribes to a newsletter, or participates in other activities, Party A requires Party B to log in to the personal data in order to complete the transaction and related member services.&lt;br /&gt;\r\nWhen Party B registers with the Laterly Community Management Service Platform, we will ask Party B for name, email, date of birth, phone number, address, etc. After Party B has registered the Laterly&amp;nbsp;account and logged in to Party A and the service, we can identify Party B&amp;#39;s identity, allow Party B to use a more complete service, or participate in related promotions, offers and prizes.&lt;br /&gt;\r\n&lt;br /&gt;\r\nThe personal data we collect will be used to inform Party B about the latest product announcements, software updates, and upcoming events on the Laterly Community Operations Platform, and may also be used to help improve our services. The personal data obtained by Party A and its related websites are only for the purpose and scope of use within Party A according to the original instructions. For example: auditing, data analysis, research, etc., to improve product, service and customer communication.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;User profile&lt;/strong&gt;&lt;br /&gt;\r\nIn order to protect the rights and interests of all members, Party B can set a set of emails and passwords for themselves during the registration process. Through this account, Party B can use the related member services according to the platform/website description. Please keep the member account and password of Party B in good condition. Do not provide the above information to anyone. After using it, please log out of Party B&amp;#39;s account. If Party B shares a computer with another person or uses a public computer, please remember to close Party B&amp;#39;s browser to prevent others from seeing the above information or obtaining a way to enter Party B&amp;#39;s account.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Collection and use of browsing materials&lt;/strong&gt;&lt;br /&gt;\r\nParty A will automatically record Party B&amp;#39;s browsing activities and other related information in the platform, but this information is only used as a traffic analysis and network behavior survey to improve the service quality of the platform and website.&lt;br /&gt;\r\nParty A will not provide Party B&amp;#39;s personal data to third parties or for other purposes unless otherwise stated or provided by law.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Revision of the Privacy Policy&lt;/strong&gt;&lt;br /&gt;\r\nParty A reserves the right to change the contents of this statement. We will not separately notify the members of the changes in the platform/website announcement. Party A will amend and change the Privacy Policy from time to time, and the privacy policy will be published on this platform/webpage. If Party B has any questions about Party A&amp;#39;s privacy protection policy, please contact Party A directly.&lt;/p&gt;');
